('node', 'blog', 0, 14, 14, 'und', 0, 'Market research today finds itself in somewhat of a quandary. Mostly, it is a field that is trying to remain relevant amidst the sea of changes taking place in marketing and sales today in the new digital and buyer experience economy. As the gatherer of market and customer data, market research is struggling to prove its value to senior management.', 'Market research today finds itself in somewhat of a quandary. Mostly, it is a field that is trying to remain relevant amidst the sea...', 'filtered_html'),
('node', 'blog', 0, 15, 15, 'und', 0, 'Market research today finds itself in somewhat of a quandary. Mostly, it is a field that is trying to remain relevant amidst the sea of changes taking place in marketing and sales today in the new digital and buyer experience economy. As the gatherer of market and customer data, market research is struggling to prove its value to senior management.\r\n\r\nMarket research today finds itself in somewhat of a quandary. Mostly, it is a field that is trying to remain relevant amidst the sea of changes taking place in marketing and sales today in the new digital and buyer experience economy. As the gatherer of market and customer data, market research is struggling to prove its value to senior management.', 'Market research today finds itself in somewhat of a quandary. Mostly, it is a field that is trying to remain relevant amidst the sea of changes ...', 'full_html'),
('node', 'blog', 0, 16, 16, 'und', 0, 'I had a dog I had to put down and it hurt just as much, I want to share this with you and everyone who has lost there beloved dog.\r\nJust this side of heaven is a place called Rainbow Bridge. When an animal dies that has been especially close to someone here, that per goes to Rainbow bridge.\r\nThere are meadows and hills for all our special friends so they can run and play together.\r\n\r\nThere is plenty of food, water and sunshine, and our friends are warm and comfortable. All the animals who have been ill and old are restored to health and vigor; those who were hurt or maimed are made whole and strong again, just as we remember them in our dreams of days and times gone by.\r\n\r\nThe animals are happy and content, except for one small thing, they each miss someone very special to them, who had to be left behind.\r\nThey all run and play together, but the day comes when one suddenly stops and looks into the distance. His bright eyes are intent; His eager body quivers. Suddenly he begins to run from the group, flying over the green grass, his legs carrying him faster and faster. You have been spotted, and when you and your special friend finally meet, you cling together in joyous reunion, never to be parted again.\r\n\r\nThe happy kisses rain upon your face; your hands again caress the beloved head, and you look once more into the trusting eyes of your pet. so long gone from your life but never absent from your heart.', 'I had a dog I had to put down and it hurt just as much, I want to share this with you and everyone who has lost there beloved dog...', 'full_html'),
('node', 'blog', 0, 17, 17, 'und', 0, 'The first is what I call the “how and why” complex. Conventionally, market research has focused on getting to the “who and what” of potential markets and customers. Gathering some good demographic information as well as finding voluminous reports on what is being purchased. With the hope of understanding trends and purchasing patterns. What is missing in many of the strategic meetings for senior executives is insight into understanding consumer or buyer behaviors and attitudes. Some may argue that psychographics provides this but psychographics focuses more on lifestyles as oppose to insightful and deep understanding into how and why consumers or buyers buy. The kind of insight that reveals competitive advantages and innovative breakthroughs.\r\n\r\nThe second challenge can be termed “proliferation” in the sense that market research has become big business. Thus, gaining insight must come from distilling volumes of reports, quantitative data, surveys, focus groups, and every imaginable new way to look at a customer that has been created in the past 20 years. There appears to be a built-in inertia related to how many reports are bought each year, how many new ways to cut and slice data, and discovering new ways to perform statistical modeling each year. I do not propose that this is entirely a bad thing but it is very easy to see today that the proliferation of choices for market research has increased substantially in the pursuit of insight.\r\n\r\nThe third challenge is one we can call “relevancy.” That is, how does market research communicate relevant and real consumer or buyer insight? I know I have and some of you have sat through presentations with beautiful slides and graphics of graphs but leave with that sinking feeling in your stomach that you really did not gain any new insight that is going to help to drive strategy. It is a challenge that senior executives today are seeking to fix for the “go-to-market” windows continue to shrink and what is needed is relevant and real consumer or buyer insight today and not tomorrow.\r\n\r\nThe fourth challenge we can liken to the nomenclature of the “silent majoirty” in the digital age. The nature of what we typically have been researching has changed so dramatically the last few years that we may be in fact not reaching out to the right consumers or buyers. And these may very well be active online types who don’t voice or interact yet they are everywhere in the social network. Watching, observing, and making decisions on these observations.\r\n\r\nMarket research, in today’s digital age, must look towards blending the power of quantitative research with advanced qualitative research methodologies to create a powerful story that can be told to senior management, personnel, and to consumers or buyers. To become a major contributor to strategy, market research will need to embrace the advantages of qualitative research and adapt to a world where numbers or data alone cannot tell the full story of consumer or buyer behavior.', 'Market research today finds itself in somewhat of a quandary. Mostly, it is a field that is trying to remain relevant amidst the sea of changes taking place in marketing and sales today in the new digital and buyer experience economy. As the gatherer of market and customer data, market research is struggling to prove its value to senior management.', 'filtered_html'),
('node', 'blog', 0, 18, 18, 'und', 0, 'Broadway veteran Idina Menzel warmed up the Oscars stage with her standout performance ofFrozen‘s Academy Award-nominated song, “Let It Go.”\r\nIn his introduction, John Travolta called Menzel “wickedly talented,” a reference to her memorable turn as Elphaba in the Broadway musical Wicked. However, Travolta flubbed Menzel’s name, calling her what sounded like Adele Naseem instead. Host Ellen DeGeneres, afterwards, called the performance “absolutely beautiful.”\r\n\r\nThe three other nominated songs were “Happy” from Despicable Me 2, ”Ordinary Love” fromMandela: Long Walk to Freedom and “The Moon Song” from Her.\r\n\r\nJust days before the Oscars, the Academy held its first concert honoring the best original score and song nominees, where nominee “Let It Go” also was spotlighted.\r\n\r\nThe 3D-animated tentpole is the 18th film to hit $1 billion worldwide at the box office, joining seven other Disney titles to reach the landmark, including The Avengers, Iron Man 3, two of the Pirates of the Caribbean installments, Alice in Wonderland and Toy Story 3. Frozen is the top-grossing original animated film of all time.', 'Envato is an ecosystem of sites to help you get creative. From our world-leading digital marketplaces where you can buy images, templates, project files and creative assets, to our education network of tutorials and courses where you can learn new skills and crafts, our sites and services help millions of people around the world.', 'full_html'),
