(14, 'node', ' this is standard image post admin s blog 11 reads market research today finds itself in somewhat of a quandary mostly it is a field that is trying to remain relevant amidst the sea of changes taking place in marketing and sales today in the new digital and buyer experience economy as the gatherer of market and customer data market research is struggling to prove its value to senior management work inspiration work creative ', 0),
(15, 'node', ' beatiful post with image slider admin s blog 20 reads market research today finds itself in somewhat of a quandary mostly it is a field that is trying to remain relevant amidst the sea of changes taking place in marketing and sales today in the new digital and buyer experience economy as the gatherer of market and customer data market research is struggling to prove its value to senior management market research today finds itself in somewhat of a quandary mostly it is a field that is trying to remain relevant amidst the sea of changes taking place in marketing and sales today in the new digital and buyer experience economy as the gatherer of market and customer data market research is struggling to prove its value to senior management travel inspiration funny life john smith not verified  oct 26 2014 1408 pm reply good morning  ', 0),
(16, 'node', ' lost dog dora reunited with family after admin s blog 27 reads i had a dog i had to put down and it hurt just as much i want to share this with you and everyone who has lost there beloved dog just this side of heaven is a place called rainbow bridge when an animal dies that has been especially close to someone here that per goes to rainbow bridge there are meadows and hills for all our special friends so they can run and play together there is plenty of food water and sunshine and our friends are warm and comfortable all the animals who have been ill and old are restored to health and vigor those who were hurt or maimed are made whole and strong again just as we remember them in our dreams of days and times gone by the animals are happy and content except for one small thing they each miss someone very special to them who had to be left behind they all run and play together but the day comes when one suddenly stops and looks into the distance his bright eyes are intent his eager body quivers suddenly he begins to run from the group flying over the green grass his legs carrying him faster and faster you have been spotted and when you and your special friend finally meet you cling together in joyous reunion never to be parted again the happy kisses rain upon your face your hands again caress the beloved head and you look once more into the trusting eyes of your pet so long gone from your life but never absent from your heart work life life dog david beckham not verified  oct 29 2014 1652 pm reply leverdog is your one stop pet care facility offering grooming daycare overnight boarding convenient pickup and dropoff times and oneonone training  ', 0),
(17, 'node', ' this is standard image post admin s blog 28 reads the first is what i call the how and why complex conventionally market research has focused on getting to the who and what of potential markets and customers gathering some good demographic information as well as finding voluminous reports on what is being purchased with the hope of understanding trends and purchasing patterns what is missing in many of the strategic meetings for senior executives is insight into understanding consumer or buyer behaviors and attitudes some may argue that psychographics provides this but psychographics focuses more on lifestyles as oppose to insightful and deep understanding into how and why consumers or buyers buy the kind of insight that reveals competitive advantages and innovative breakthroughs the second challenge can be termed proliferation in the sense that market research has become big business thus gaining insight must come from distilling volumes of reports quantitative data surveys focus groups and every imaginable new way to look at a customer that has been created in the past 20 years there appears to be a builtin inertia related to how many reports are bought each year how many new ways to cut and slice data and discovering new ways to perform statistical modeling each year i do not propose that this is entirely a bad thing but it is very easy to see today that the proliferation of choices for market research has increased substantially in the pursuit of insight the third challenge is one we can call relevancy that is how does market research communicate relevant and real consumer or buyer insight i know i have and some of you have sat through presentations with beautiful slides and graphics of graphs but leave with that sinking feeling in your stomach that you really did not gain any new insight that is going to help to drive strategy it is a challenge that senior executives today are seeking to fix for the gotomarket windows continue to shrink and what is needed is relevant and real consumer or buyer insight today and not tomorrow the fourth challenge we can liken to the nomenclature of the silent majoirty in the digital age the nature of what we typically have been researching has changed so dramatically the last few years that we may be in fact not reaching out to the right consumers or buyers and these may very well be active online types who don t voice or interact yet they are everywhere in the social network watching observing and making decisions on these observations market research in today s digital age must look towards blending the power of quantitative research with advanced qualitative research methodologies to create a powerful story that can be told to senior management personnel and to consumers or buyers to become a major contributor to strategy market research will need to embrace the advantages of qualitative research and adapt to a world where numbers or data alone cannot tell the full story of consumer or buyer behavior creative music city ', 0),
(18, 'node', ' visited envato in a nice day admin s blog 106 reads broadway veteran idina menzel warmed up the oscars stage with her standout performance offrozen s academy awardnominated song let it go in his introduction john travolta called menzel wickedly talented a reference to her memorable turn as elphaba in the broadway musical wicked however travolta flubbed menzel s name calling her what sounded like adele naseem instead host ellen degeneres afterwards called the performance absolutely beautiful the three other nominated songs were happy from despicable me 2 ordinary love frommandela long walk to freedom and the moon song from her just days before the oscars the academy held its first concert honoring the best original score and song nominees where nominee let it go also was spotlighted the 3danimated tentpole is the 18th film to hit 1 billion worldwide at the box office joining seven other disney titles to reach the landmark including the avengers iron man 3 two of the pirates of the caribbean installments alice in wonderland and toy story 3 frozen is the topgrossing original animated film of all time travel life life travel bryan adam not verified  oct 28 2014 1222 pm reply i like song admin oct 28 2014 1517 pm reply cached pages will not be recreated until at least this much time has elapsed bryan john not verified  oct 28 2014 1536 pm reply after avatar korra announced her official relocation to republic city  ', 0),
